// https://leetcode.cn/problems/A1NYOS/

// 看到这个题，最方便的计算方法，应该就是给中间的0，改为-1来计算，之后求和为0的最长子数组
// 最简单的方法，应该就是双层循环了吧
// 当然，这个方法对，但是会超时
func findMaxLengthXunhuan(nums []int) int {
	s, e := 0, 0
	for i := 0; i < len(nums); i++ {
		sum := addNum(nums[i])
		for j := i + 1; j < len(nums); j++ {
			sum += addNum(nums[j])
			if sum == 0 && j-i > e-s {
				s, e = i, j
			}
		}
	}

	if e == s {
		return 0
	}
	return e - s + 1
}

// 记录一下，当前最长的结果，之后for的时候，可以跳过这个累加的计算，算是一部分剪枝，但是也超时了
func findMaxLengthJianzhi(nums []int) int {
	s, e := 0, 0
	sums := make([]int, len(nums))
	sums[0] = addNum(nums[0])
	for i := 1; i < len(nums); i++ {
		if nums[i] == 0 {
			nums[i] = -1
		}
		sums[i] = sums[i-1] + nums[i]
	}
	for i := 0; i < len(nums) && i+e-s < len(nums); i++ {
		sum := nums[i]
		if i > 0 {
			sum = sums[i+e-s] - sums[i-1]
		}
		for j := i + e - s + 1; j < len(nums); j++ {
			sum += nums[j]
			if sum == 0 && j-i > e-s {
				s, e = i, j
			}
		}
	}

	if e == s {
		return 0
	}
	return e - s + 1
}

// 是否可以做成动态规划，需要好好构思一下
// 我们可以记录一下累加的和的，最小位置，之后在后面出现这个累加和的时候，那么index的差就是结果了，之后这些结果里面，取一个最大值
func findMaxLength(nums []int) int {
	var sum, res int
	sumMap := make(map[int]int) // sum to minIndex
	sumMap[0] = -1              // 和为0，是特殊的，直接减去-1就是结果了
	for i := 0; i < len(nums); i++ {
		if nums[i] == 0 {
			nums[i] = -1
		}
		sum += nums[i]
		if minIndex, ok := sumMap[sum]; ok {
			res = max(res, i-minIndex)
		} else {
			sumMap[sum] = i
		}
	}
	return res
}

func max(m, n int) int {
	if m > n {
		return m
	}
	return n
}

func addNum(n int) int {
	if n == 0 {
		return -1
	}
	return n
}

